DROP TABLE IF EXISTS `am_paper`;
CREATE TABLE `am_paper` (
  `paper_id` int unsigned NOT NULL COMMENT '论文ID (1~1,000,000,000)',
  `source` varchar(255) NOT NULL DEFAULT '' COMMENT '数据来源',
  `title` varchar(2500) NOT NULL COMMENT '论文标题',
  `doi` varchar(200) NOT NULL DEFAULT '' COMMENT '唯一标识',
  `year` smallint unsigned NOT NULL DEFAULT '0' COMMENT '​发布年份',
  `doc_type` tinyint unsigned NOT NULL DEFAULT '0' COMMENT '论文类型 0未设置 1Book 2BookChapter 3Conference 4Journal 5Patent 6Dataset 7Repository 8Thesis',
  `date` date DEFAULT NULL COMMENT '发布日期',
  `journal_id` int unsigned NOT NULL DEFAULT '0' COMMENT '期刊ID',
  `conference_series_id` int unsigned NOT NULL DEFAULT '0' COMMENT '活动组织者ID',
  `conference_instance_id` int unsigned NOT NULL DEFAULT '0' COMMENT '​具体会议ID',
  `volume` int NOT NULL DEFAULT '0' COMMENT '卷',
  `issue` int NOT NULL DEFAULT '0' COMMENT '刊',
  `first_page` int NOT NULL DEFAULT '0' COMMENT '起始页',
  `last_page` int NOT NULL DEFAULT '0' COMMENT '终止页',
  `created_at` int unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `updated_at` int unsigned NOT NULL DEFAULT '0' COMMENT '最后更新',
  PRIMARY KEY (`paper_id`),
  KEY `journal_id` (`journal_id`),
  KEY `conference_series_id` (`conference_series_id`),
  KEY `conference_instance_id` (`conference_instance_id`),
  KEY `year` (`year`) USING BTREE COMMENT '年份索引',
  KEY `created_at` (`created_at`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='论文表';

